// src/pages/SignupPage.js
import React, { useState } from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';

function SignupPage() {
  const [userType, setUserType] = useState('buyer');

  const handleSubmit = (e) => {
    e.preventDefault();
    const name = e.target.name.value;
    const email = e.target.email.value;
    const password = e.target.password.value;
    const confirmPassword = e.target.confirmPassword.value;

    if (password !== confirmPassword) {
      alert('Passwords do not match!');
      return;
    }

    console.log('Sign Up attempt:', { name, email, password, userType });
    window.location.href = '/login';
  };

  return (
    <>
      <Navbar />
      <div className="auth-container">
        <div className="auth-card">
          <div className="auth-header">
            <h2>Sign Up for LocalMart</h2>
            <p>Create an account to start using LocalMart</p>
          </div>
          <form className="auth-form" onSubmit={handleSubmit}>
            <div className="form-group">
              <label htmlFor="name">Full Name</label>
              <div className="input-group">
                <i className="fas fa-user"></i>
                <input type="text" id="name" name="name" placeholder="Enter your full name" required />
              </div>
            </div>
            <div className="form-group">
              <label htmlFor="email">Email</label>
              <div className="input-group">
                <i className="fas fa-envelope"></i>
                <input type="email" id="email" name="email" placeholder="Enter your email" required />
              </div>
            </div>
            <div className="form-group">
              <label htmlFor="password">Password</label>
              <div className="input-group">
                <i className="fas fa-lock"></i>
                <input type="password" id="password" name="password" placeholder="Enter your password" required />
              </div>
            </div>
            <div className="form-group">
              <label htmlFor="confirmPassword">Confirm Password</label>
              <div className="input-group">
                <i className="fas fa-lock"></i>
                <input type="password" id="confirmPassword" name="confirmPassword" placeholder="Confirm your password" required />
              </div>
            </div>
            <div className="user-type">
              <p>Select your user type:</p>
              <div className="type-options">
                <div
                  className={`type-option ${userType === 'buyer' ? 'active' : ''}`}
                  onClick={() => setUserType('buyer')}
                >
                  <i className="fas fa-shopping-bag"></i>
                  <h4>Buyer</h4>
                </div>
                <div
                  className={`type-option ${userType === 'seller' ? 'active' : ''}`}
                  onClick={() => setUserType('seller')}
                >
                  <i className="fas fa-store"></i>
                  <h4>Seller</h4>
                </div>
              </div>
            </div>
            <button type="submit">Sign Up</button>
          </form>
          <div className="auth-footer">
            <p>
              Already have an account? <a href="/login">Login</a>
            </p>
          </div>
        </div>
      </div>
      <Footer />
    </>
  );
}

export default SignupPage;
